def insertElement(arr, newElement):
    """"""
    n = len(arr)
    start = 0
    end = n - 1
    while start <= end:
        mid = (start + end) // 2
        if newElement == arr[mid]:
            arr.insert(mid + 1, newElement)
            return arr
        if newElement < arr[mid]:
            end = mid - 1
        else:
            start = mid + 1
    arr.insert(start + 1, newElement)
    return arr
